import React from "react";

import Layout from "../../../components/Layout";
import Products from "../../../components/Products";
import { Provider } from "../../../context";

const CategoryPage = () => {
  return (
    <Provider>
      <Layout>
        <Products />
      </Layout>
    </Provider>
  );
};

export default CategoryPage;
